import React from "react";
import {NavLink} from "react-router-dom";

const Menu = () => {
    return (
        <>
            <NavLink activeClassName = {classStyle} to = "/about">About Us</NavLink>
            <NavLink to = "/service">Service Us</NavLink>
        </>
    )
}

export default Menu;
